INT1 = struct.Struct('>B')
INT2 = struct.Struct('>H')
INT4 = struct.Struct('>I')

def bits_to_int(bits):
	''' little endian to integer '''
	acc = 0
	for b in bits:
		acc = (acc << 1) | b
	return acc

class CanTemplate(object):
	"""
		docstring for CanTemplate
		signals : {name : (bitstart, bitlen, is_big_endian)}
	"""
	def __init__(self, signals, name=None, id=None):
		super().__init__()
		self.name    = name
		self.id      = id
		self.signals = {sig['N'] : (sig['SB'], sig['BL'], sig['BE']) for sig in signals}
	def get_val(self, signame, can):
		signal = self.signals[signame]
		b_start = signal[0]
		b_len   = signal[1]
		is_big  = signal[2]
		val = can[1][b_start:b_start + b_len]
		if is_big:
			val.reverse()
		return bits_to_int(val)
	def compare(self, can1, can2, signals=None):
		if signals is None:
			signals = self.signals.keys()
		if can1[0] != can2[0]:
			return False
		for name in signals:
			if self.get_val(name, can1) != self.get_val(name, can2):
				return False
		return True
	# exclude zeroes
	def split_to_signals(self, can):
		for name in self.signals.keys():
			val = self.get_val(can, name)
			if val != 0:
				yield (name, val)
	def contain_signal(self, signame):
		return signame in self.signals
	def keys(self):
		return self.signals.keys()


class CANBase(object):
	"""
		format of zipped data:
		{mess_id : {'N' : name, 'S': signals}}
			where 
				signals = [{'N' : name, 'SB' : start big, 'BL' : bit len, 'BE' : is big endian, 'O' : offset}]
	"""
	zip_base = {
			"Atlantis" : {
 				"BHCAN": b'',
 				"C1CAN": b'',
			},
			"CUSW" : {
 				"BHCAN": b'',
 				"CCAN": b'',
			},
			"PNET" : {
 				"BHCAN": b'',
 				"CCAN": b'',
			},
		}

	@classmethod
	def arch(cls, archname):
		acc = []
		for can in cls.zip_base[archname].keys():
			acc.append(cls(archname, can))
		return acc
	def __init__(self, architect, cantype):
		super().__init__()
		self.architect = architect
		self.can = cantype
		orig = self.__class__.zip_base[architect][cantype]
		self.by_id = {}
		self.name_to_id = {}
		js = json.loads(bz2.decompress(binascii.unhexlify(orig)))
		for key,val in js.items():
			key = int(key)
			name = val['N']
			self.by_id[key] = CanTemplate(val['S'], name, key)
			self.name_to_id[name] = key
	def get_name(self, name):
		return self.by_id[self.name_to_id[name]]
	def get_id(self, id):
		return self.by_id[id]
	def all_id(self):
		return self.by_id.keys()
	def all_names(self):
		return self.name_to_id.keys()
	def all_signals(self):
		for mess in self.by_id.values():
			for key in mess.keys():
				yield key

class Utils(object):
	def __init__(self, arch):
		self.bases = CANBase.arch(arch)
	def print_val(self, mess):
		found = False
		for base in self.bases:
			try:
				templ = base.get_id(mess[0])
				print('IN BASE %s FOUND %s' % (base.can, templ.name) )
				for name in templ.signals.keys():
					print('\t%s = %s' % (name, templ.get_val(name, mess)))
				found = True
			except KeyError:
				continue
		if not found:
			print('NOT FOUND')
	def print_name(self, mess_name):
		found = False
		for base in self.bases:
			try:
				id = base.name_to_id[mess_name]
				print('IN BASE %s FOUND %s' % (base.can, hex(id)[2:]))
				found = True
			except KeyError:
				continue
		if not found:
			print('NOT FOUND')
	def _get_mess(self, func):
		for base in self.bases:
			try:
				yield func(base)
			except:
				pass
	def get_mess_id(self,id):
		return list(self._get_mess_n_base(lambda base: base.get_id(id)))
	def get_mess_name(self,name):
		return list(self._get_mess_n_base(lambda base: base.get_name(name)))

def read_can(text):
	''' read mess like this 03f 00 04 00 11 00 00 00 00 '''
	split = text.split(' ')
	key = int(split[0], 16)
	split = split[1:]
	# split.reverse()
	val = bitarray()
	mess = ''.join(split)
	if len(mess) > 16:
		raise Exception('read_CAN', 'message very long')
	for i in range(16 - len(mess)):
		mess += '0'
	val.frombytes(binascii.unhexlify(mess))
	return (key,val)

class MessageMask(object):
	'''
		use for .match message with template
		note: this class doesn't check message id
		only check value
		for read_bytes used big endian
	'''
	def __init__(self, signals, mask, template):
		# signals : [(name,value)]
		self.signals = signals
		# binary mask
		self.mask = mask
		self.template = template
		if self.mask is None:
			self.match = self._match_bin
		else:
			self.match = self._match_sigs

	@classmethod
	def read_bits(cls, text):
		mask = [2 if (c == '.') else int(c) for c in text]
		return cls(None, bytes(mask), None)

	@classmethod
	def read_bytes(cls, text):
		mask = []		
		for c in ''.join(text.split(' ')):
			if c == '.':
				mask.extend([2,2,2,2])
			else:
				txt = bin(int(c, 16))[2:]
				val = [int(c, 10) for c in txt]
				for _ in range(4 - len(val)):
					txt = [0] + val
				mask.extend(val)
		return cls(None, bytes(mask), None)

	@classmethod
	def read_signals(cls, template, text):
		''' format: a=12, b=b010110, c=x3f4 ... '''
		ID  = re.compile('[a-zA-Z_][a-zA-Z_0-9]*')
		def read_pair(text):
			pair = text.split('=')
			try:
				assert len(pair) == 2
				key = pair[0].strip()
				assert ID.match(key)
				assert template.contain_signal(key)
				val = int(pair[1].strip(), 0)
			except:
				raise Exception('MessageMask.read_signals', 'incorrect signals format')
			return (key,val)
		signals = [read_pair(pair) for pair in text.split(',')]
		return cls(signals, None, template)

	def _match_bin(self, canmess):
		mask = self.mask
		canmess = canmess[1]
		for i in range(64):
			bit = mask[i]
			if bit != 2 and bit != canmess[i]:
				return False
		return True

	def _match_sigs(self, canmess):
		for sig in self.signals:
			if self.template.get_val(sig[0], canmess) != sig[1]:
				return False
		return True

def read_log(path):
	result = []
	with open(path) as hdr:
		for line in hdr:
			split = line.split('\t')
			result.append( (line, split[1], read_can(split[-1])) )
	return result

def main():
	parser = argparse.ArgumentParser(description='')
	# selfdir = os.path.dirname(__file__)
	parser.add_argument('--what', help='description of message or code of name')
	parser.add_argument('--find', help='find messages in log')
	parser.add_argument('-m', help='mask for find mode')
	parser.add_argument('-o', help='out file for find mode')
	parser.add_argument('-l', help='log file')
	parser.add_argument('-a', help='architect')
	# add argument --frequency
	args = vars(parser.parse_args())
	if args['a'] is None:
		print('no arch')
		return
	if args['what']:
		utils = Utils(args['a'])
		mess = args['what']
		try:
			can_m = read_can(mess)
		except:
			can_m = None
		if can_m:
			utils.print_val(can_m)
		else:
			utils.print_name(mess)
		return
	if args['find']:
		key = args['find']
		templates = []
		try:
			key = int(key,16)
			templates = utils.get_mess_id(key)
		except:
			templates = utils.get_mess_name(key)
		if len(templates) == 0:
			print('no mess %s found' % key)
			return
		if templates[0].id == templates[1].id:
			del templates[1]
		mask = []
		if args['m']:
			src = args['m']
			if src[0] == 'b':
				for _ in templates:
					mask.append(MessageMask.read_bits(src[1:]))
			elif src[0] == 'x':
				for _ in templates:
					mask.append(MessageMask.read_bytes(src[1:]))
			elif src[0] == '{':
				correct_mask_exist = False
				for template in templates:
					try:
						mask.append(MessageMask.read_signals(template, src))
						correct_mask_exist = True
					except:
						mask.append(None)
				if not correct_mask_exist:
					print('mask incorrect')
					return
			else:
				print('incorrect mask format')
				return
		if 'l' not in args:
			print('log not setted')
			return
		out = None
		if 'o' in args:
			out = open(args['o'], 'wt')
		def write_out(line):
			if out:
				out.write(line[0])
				out.write('\n')
		log = read_log(args['l'])
		for line in log:
			index = line[1]
			can   = line[2]
			for i in range(len(templates)):
				template = templates[i]
				if len(mask) == 0:
					if can[0] == template.id:
						print(index)
						write_out(line)
				if mask[i] is None:
					continue
				else:
					if can[0] == template.id and mask[i].match(can):
						print(index)
						write_out(line)
		if out:
			out.close()

if __name__ == '__main__':
	main()